commits.content:
@import '../style/scss/_variables';

.header-wrap {
    height:48px;
    position: sticky;
    display:flex;
    justify-content: space-between;
    border-bottom:1px solid #EBEEF0;
    box-sizing: border-box;
	background-color: #white;
    button {
		display: inline-block;
		width: 32px;
		height: 32px;

		&.icon-header-back {
			flex: 0 0 auto;
			background: url(../styles/assets/images/icon/icon-header-back.svg) no-repeat 4px
				center/32px 32px;
		}

		&.icon-header-menu {
			background: url(../styles/assets/images/icon/icon-header-menu.svg) no-repeat center
				center/32px 32px;
		}

		&.icon-header-close {
			background: url(../styles/assets/images/icon/icon-header-close.svg) no-repeat center
				center/32px 32px;
		}

		&[class*='button-default'] {
			width: auto;
			height: auto;
		}
	}
}
.header-left {
    display:flex;
    align-items: center;
    margin-left:12px;
    button {
        + h1 {
            margin-left:8px;
        }
    }
    h1 {
        font-size:20px;
        line-height:48px;
        margin:0;
    }
}
.header-right {
	display:flex;
    align-items: center;
    margin-left:12px;
}
